    @Test
    public void recordPull() {
        RecordPullRequest req = new RecordPullRequest();
        req.setReplayTaskRunId("rp_id_4acc22dd6ceacdf3b4ec9c1587dde8a8");
        req.setRecordTaskRunId("rc_id_0d924ab71cc3ddf41c8cec696c27kimi");

        RecordPullModel model = replayService.replayDataPull(req);
        log.info("first query req={} model={}", JSON.toJSONString(req), JSON.toJSONString(model));

        int i = 0;
        while (null != model && model.getHasNext() && !StringUtils.isEmpty(model.getScrollId())) {
            req.setScrollId(model.getScrollId());
            model = replayService.replayDataPull(req);
            log.info("{} th query req={} model={}", ++i, JSON.toJSONString(req), JSON.toJSONString(model));
        }
        log.info("end query");
    }

